import React from "react";
import uniqid from "uniqid";

export default function CardGrid({ characters, onClick }) {
  return (
    <div className="demo-grid">
      {characters.map((char) => (
        <img
          key={char.id}
          src={char.image}
          alt={char.name}
          onClick={onClick}
          clicked={char.clicked}
        />
      ))}
    </div>
  );
}
